// Modified as part of build error fix task on 2025-05-08, 2:40:56 AM
// Aggregating English locale data from JSON files in the 'en' subdirectory.
import analytics from './en/analytics.json';
import auth from './en/auth.json';
import common from './en/common.json';
import dashboard from './en/dashboard.json';
import inventory from './en/inventory.json';
import receipts from './en/receipts.json';
import settings from './en/settings.json';

export default {
  analytics,
  auth,
  common,
  dashboard,
  inventory,
  receipts,
  settings,
};
